// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract Aggregator {
    mapping(string => address) ERC20ToUSD;

    /// @notice Establishes a map of tokens to USD from Chainlink Goerli ( https://docs.chain.link/data-feeds/price-feeds/addresses/?network=ethereum#Goerli%20Testnet )
    /// @dev Only tokens that have a conversion to USD are present.
    constructor() {
        ERC20ToUSD['LINK'] = 0x48731cF7e84dc94C5f84577882c14Be11a5B7456;
        ERC20ToUSD['ETH']  = 0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e;
        ERC20ToUSD['DAI']  = 0x0d79df66BE487753B02D015Fb622DED7f0E9798d;
        ERC20ToUSD['BTC']  = 0xA39434A63A52E749F02807ae27335515BA4b07F7;
    }

    /// @notice Retrieve the actual price of a given token.
    /// @param _symbol The symbol of the token.
    /// @return The price in USD for the token.
    function getLatestPrice(string memory _symbol) public view returns (int256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(ERC20ToUSD[_symbol]);
        (
            ,
            /*uint80 roundID*/
            int256 price, /*uint startedAt*/ /*uint timeStamp*/ /*uint80 answeredInRound*/
            ,
            ,

        ) = priceFeed.latestRoundData();

        return price;
    }
}

